import React, { Component } from 'react';


class Nav extends Component {
    render() {
        return (
            <div className='container-fluid'>
                <div class="row">
                    <div class="col-3 bg-primary">
                        One of three columns
                    </div>
                    <div class="col-6 bg-primary">
                        One of three columns
                    </div>
                    <div class="col-3 bg-primary">
                        One of three columns
                    </div>
                </div>
            </div>
        );
    }
}

export default Nav;
